import React from 'react';




const LaptopList = () => {

    if(laptops.lenght === 0){
		return <p>Loading...</p>
	}


    const LaptopElements = laptops.map((laptop) => {
        const detailUrl = "/laptops/" + laptop.id
			return (
			<li key={laptop.id} className="component-item">
				<div>
				<Link to={detailUrl}><Laptop laptop={laptop}/></Link>
				</div>
			</li>
		)
		})

	return (
		<div className="component-list">
			{laptopElements}
		</div>

	)

}

export default LaptopList;
